import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './components/Home';
import About from './components/About';
import Breakfast from './components//Breakfast';
import Contact from './components//Contact';
import Footer from './components/Footer';  // Importe o Footer
import './index.css';
import pousadaImage from './assets/pousada.jpg'; // Importe a imagem

const App = () => {
  return (
    <Router>
      <Navbar />
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/about" component={About} />
        <Route path="/breakfast" component={Breakfast} />
        <Route path="/contact" component={Contact} />
      </Switch>
    </Router>
  );
  return (
    <div className="App">
      <Navbar />
      <main>
        <h2>Bem-vindo à Pousada Pinheira</h2>
        <p>Localizada na bela Praia de Cima, oferecemos conforto e tranquilidade para suas férias.</p>

        <img src={pousadaImage} alt="Pousada Pinheira" style={{ width: '100%', maxWidth: '800px', height: 'auto', borderRadius: '8px' }} />

        <p>Saiba mais sobre nós.</p>
      </main>
      <Footer />  {/* Adicione o Footer */}
    </div>
  );
}


export default App;
